package JavaLogicProgms;

public class IsAlphabate {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		char c='A';
		
		if((c>='a'&&c<='z') ||(c>='A'&&c<='Z'))
			System.out.println(c+" is an Alphabate");
		else
			System.out.println(c+" is NOT an Alphabate");

	}

}
